{'pk': 18098135767082453, 'user_id': 4325702902, 'text': '⁉ ¿Cómo hacer para que la relación con las personas que nos rodean sea armoniosa? ¿Cómo hacer para que no nos molesten sus actitudes, aunque muchas veces nos perjudiquen? ¿Cómo generar amor en cada situación, para que la persona que nos genera molestia o enojo se vuelva un hermano del alma? ⁉
.
@claudiomariadominguezok nos presenta un libro que responde a estos interrogantes y nos propone, mediante prácticas y ejercicios concretos, herramientas maravillosas para superar la ira y vivir en paz y armonía. Claudio despliega su genialidad didáctica y su modo llano de explicar, mediante metáforas e historias, un método eficaz que podrás aplicar cada vez que sientas llegar esa fuerza negativa, que tanto mal nos hace a nosotros mismos y a quienes nos rodean. 
Un verdadero manual acerca del amor, que nos plantea el desafío de comprender al otro, nos hace descubrir la magia del perdón, nos enseña que la alegría puede ser la mejor terapia y que el amor puede sanarlo todo.
.
