{'pk': 18022664482255598, 'user_id': 4325702902, 'text': '🤔 ¿El destino es un poder sobrenatural inevitable que guía nuestros actos hacia un fin independiente del que nosotros hayamos escogido? ¿O en realidad no necesariamente debería encadenarnos? 🤔
.
@andreabrunocoach, en sus libros, ha explicado siempre cómo uno puede convertirse en artífice de su propia vida. Sobre la psique del ser humano existe una suerte de yunque que aplasta nuestra capacidad de desplegar el instinto creador con el que nacemos. Ese peso que nos oprime, al que ella le da el nombre de memorias, no es otra cosa que una cantidad de limitantes que hemos ido aprendiendo a lo largo de nuestra vida hasta convencernos de que no había otro remedio que aceptar lo que “el destino nos deparara”. .
Este libro trata de eso: terminar con los factores limitantes y tomar las riendas de nuestro destino. Tenemos que comprender que somos seres creativos y creadores de realidades inimaginables. .
