{'pk': 18020833363261727, 'user_id': 4325702902, 'text': 'El signo zodiacal de nuestros ancestros nos permite abrir un panorama increíble respecto a las historias familiares que recibimos como legado, a la vez que nos ayuda a entender las complejidades y riquezas que forman parte de la herencia compartida con otros miembros de una misma familia.
Cuando nos animamos a sondear en ese pasado condicionante, nos damos cuenta de cuáles son los patrones comunes que nos influyen y limitan, liberándonos de todos esos códigos que nos alienan. Pero también se abre ante nuestros ojos un horizonte más amplio, que nos lleva a descubrir nuestra verdadera esencia y nuestro lugar dentro del árbol familiar, cuya potencia se convierte en un apoyo que sustenta y enriquece nuestra visión personal de la vida.

