{'pk': 18110617603079961, 'user_id': 4325702902, 'text': '¿Cuál es la meta más difícil de conseguir? ⚖ Encontrar un equilibrio que nos ponga a salvo de las presiones externas y de nuestras propias desmesuras, de las encrucijadas y trampas de nuestra conciencia. 
@dr.daniellopezrosetti lo sabe y por eso con rigor, erudición, y a la vez de manera didáctica y amena, armado de literaturas, pero también de estudios técnicos, nos explica cómo pensamos, cómo sentimos y cómo tomamos decisiones, en un largo y minucioso escaneo de nuestras conductas y nuestros grandes malentendidos. El resultado es un análisis clínico completo de la maquinaria secreta que nos maneja. ¡Uno de los libros más vendidos de 2019!

