{'pk': 17930397874345710, 'user_id': 4325702902, 'text': '🔖 Una invitación a la reflexión, que le abrirá las puertas a la plenitud espiritual y le permitirá ver la vida con nuevos ojos y empezar a disfrutar del verdadero poder del ahora. 🔖

Su autor, Eckhart Tolle, se convirtió en un maestro universal, con un gran mensaje: es posible vivir libre del sufrimiento, de la ansiedad y la neurosis. Sólo tenemos que comprender nuestro papel de creadores de nuestro dolor. Es nuestra propia mente la que causa nuestros problemas con su corriente constante de pensamientos, aferrándose al pasado, preocupándose por el futuro. Cometemos el error de identificarnos con ella, de pensar que eso es lo que somos, cuando de hecho somos seres mucho más grandes. “El poder del ahora” tiene la capacidad de crear una experiencia en los lectores y de cambiar su vida. Hoy ya es considerado una obra maestra.

